Content-Type: text/plain;
	charset=&quot;us-ascii&quot;
Content-Transfer-Encoding: 7bit

I posted quite A LOT over the past three days!  Can&#39;t believe my first days
and I have over 20 clips.. amazing.  So I took them off to make space and
opened an ESNIPS account.  http://www.esnips.com/FoldersAction.ns . I think
there is about 30% open now :-)



To all the new researchers out there that have no idea where to start or how
to do this I want you to know that I was YOU less than 3 months ago.  I am
not technical AT ALL.  I didn&#39;t think I could do that part of it you know..
hacking a radio.. me.. no way!  But I purchased a 12-470 and hacked it -
easy.  I bought an Olympus WS-100 digital recorder and turned everything on
and BAM - It worked.  



I have only been working with my RS12-470 for 3 days and I have close to 30
recorded message clips.  Some of the clips are amazing!  Click the ESNIPS
link to hear all but I decided to leave two messages in my folder (Kristin&#39;s
Files) here at this site as examples for a few more days.  These two are
strong examples of the type of messages I am getting out of the gate!  The
first message my husband walked into the room while I recorded and I asked
the box to say hello to him.. it did. It said HOWDY.  The 2nd example was me
just asking for a name or names and you will clearly heard BOBBY AND PETE.  



Good luck to the new researchers.  Don&#39;t let your inexperience or doubt
about your technical abilities keep you from attempting this.  Just DO IT!

Thanks Frank for starting this modern ITC revolution and a forum and place
to learn!

k





  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
purplespacefriend
Sent: Friday, February 29, 2008 12:57 AM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] No Room!



Hi All;

I was going to upload an audio test fo the shielded RVG, but stroage 
space is about 95% used up. You can&#39;t just uplaod files and leave them. 
Frank-S




